import React from 'react'
import axios from 'axios'

class PokoList extends React.Component{
    state={
        data:''
    }
    componentDidMount(){
        axios.get('https://pokeapi.co/api/v2/pokemon/')
        .then(res=>{
            console.log(res);
            this.setState({data:res.results})
        })
    }
    render(){
        return(
            <div>
                <p>Pokemon List</p>
            </div>
        )
    }
}
export default PokoList;
